import React, {Component} from 'react';

class App extends Component {

  constructor() {
    super();
    this.state = { data: {} };
  }

  componentDidMount() {

    var self = this;

    fetch('https://reqres.in/api/users?page=1')
      .then(function(response) {
        return response.json()
      }).then(function(data) {
        self.setState({ data });
  });
}

  render() {
      return (
        <div className="App">

        <ul>
          {data.map(item => (
            <li key={item.id}>
              Name: {item.first_name} | Email: {item.email}}
            </li>
          ))};
        </ul>

        </div>
      );
    }
  }

export default App;
